function isInUse(CI_sysID)
{
 var gr = new GlideRecord("cmdb_ci");
 gr.addQuery("sys_id", CI_sysID);
 gr.query();
 if (gr.next()) {
	 //workflow.info("gr.install_status= " + gr.install_status);

   if (gr.install_status ==1 ) {return true;}
	return false;
   }
}

