function isOutFileInOutDir() {
var dResult = data.get(7).result; // result of previous list in string type
var dirResult = new global.JSON().decode(dResult); // converts string to JSON object
var ln=dirResult["FileInfos"].length - 1;   //gets the num of lines
var i=0;

// while cycle lists the files in the directory
while (i <= ln)
{
 if (dirResult["FileInfos"][i]["Type"] != "d") {
	  
	 if (dirResult["FileInfos"][i]["Name"] == outFile ) {workflow.info("Found: " + outFile);return 'yes';} 
 } 
 i++;
}
 workflow.info("Did not found: " + outFile);
 return 'no';
}

